// src/pages/SearchPage.js
import React, { useState } from 'react';

const SearchPage = () => {
  // Состояние для хранения значения поиска
  const [searchValue, setSearchValue] = useState('');
  // Состояние для хранения результата поиска
  const [searchResult, setSearchResult] = useState('');

  // Обработчик изменения значения поиска
  const onChangeSearchInput = (e) => {
    setSearchValue(e.target.value);
  };

  // Обработчик кнопки поиска
  const handleSearch = () => {
    // Здесь вы можете добавить логику поиска, используя searchValue
    // В данном случае мы просто устанавливаем результат поиска
    setSearchResult(`Search result for: "${searchValue}"`);
  };

  return (
    <div className="content p-40">
      <div className="d-flex align-center justify-between mb-40">
        <h1>Search Page</h1>
        <div className="search-block d-flex">
          <input
            onChange={onChangeSearchInput}
            value={searchValue}
            placeholder="Search"
          />
          <button onClick={handleSearch}>Search</button>
        </div>
      </div>

      {/* Отображение результата поиска */}
      <div>{searchResult}</div>
    </div>
  );
};

export default SearchPage;
